// SillyObject replaces a value with a random object that is known to potentially cause problems.
type SillyObject struct{}

// ID returns mutator's 3-digit ID.
func (m *SillyObject) ID() string {
	return "020"
}

// Name returns the mutator's name.
func (m *SillyObject) Name() string {
	return "Silly Object"
}

// Description returns the mutator's description.
func (m *SillyObject) Description() string {
	return "Replace value with random silly object"
}

// CompatibleKinds returns the data types that the mutator can mutate.
func (m *SillyObject) CompatibleKinds() []reflect.Kind {
	return []reflect.Kind{reflect.String, reflect.Int, reflect.Int8, reflect.Int16, reflect.Int32, reflect.Int64, reflect.Uint, reflect.Uint8, reflect.Uint16, reflect.Uint32, reflect.Uint64, reflect.Float32, reflect.Float64, reflect.Invalid}
}

// Mutate returns a random object that is known to potentially cause problems.
func (m *SillyObject) Mutate(subject reflect.Value, r *rand.Rand) interface{} {
	var payload interface{}
	json.Unmarshal([]byte(sillyObjectPayloads[r.Intn(len(sillyObjectPayloads))]), &payload)
	return payload
}
